          <h2>{item1.name}</h2>
          <p>calories: {cal1}</p>
          <p>fat: {fat1}grams</p>
          <p>vitamin E: {vitE1}</p>
          <p>sugar: {sugar1}g</p>
        </div>)
    }
    { this.state.item2Card &&
      (<div className="display2" style={{ width: '350px', height: '300px'}}>
          <h2>{item2.name}</h2>
          <p>calories: {cal2}</p>
          <p>fat: {fat2}grams</p>
          <p>vitamin E: {vitE2}</p>
          <p>sugar: {sugar2}g</p>
        </div>)
    }
    </main>
  )
}

export default Compare;
